script: |
  super -f text -I q430.spq | sort > q430.out

inputs:
  - name: q430.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col0 + - + 36 BETWEEN + + ( + 29 ) * - - col1 AND - - 87;
  - name: tab2

outputs:
  - name: q430.out
    data: |
      46	51	23
      64	77	40
      75	67	58
